import{_ as e}from"./chunks/v5_nano_01.BFDPyset.js";import{_ as a,a as r,b as l,c as o,d as t,e as n,f as i}from"./chunks/v5_nano_pinouts.BxCkNroR.js";import{_ as s,c as d,o as h,ab as c}from"./chunks/framework.CUflZczI.js";const A=JSON.parse('{"title":"CUAV V5 nano 배선 빠른 시작","description":"","frontmatter":{},"headers":[],"relativePath":"ko/assembly/quick_start_cuav_v5_nano.md","filePath":"ko/assembly/quick_start_cuav_v5_nano.md"}'),p={name:"ko/assembly/quick_start_cuav_v5_nano.md"},m=c('<h1 id="cuav-v5-nano-배선-빠른-시작" tabindex="-1">CUAV V5 nano 배선 빠른 시작 <a class="header-anchor" href="#cuav-v5-nano-배선-빠른-시작" aria-label="Permalink to &quot;CUAV V5 nano 배선 빠른 시작&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">PX4에서는 이 자동 항법 장치를 제조하지 않습니다. 하드웨어 지원이나 호환 문제는 <a href="https://store.cuav.net/" target="_blank" rel="noreferrer">제조사</a>에 문의하십시오.</p></div><p>이 설명서는 <a href="./../flight_controller/cuav_v5_nano.html"> CUAV V5 nano</a> 비행 콘트롤러의 전원 공급 방법과 주요 주변 장치 연결 방법을 설명합니다.</p><p><img src="'+e+'" alt="Nano Hero Image"></p><h2 id="배선-개요" tabindex="-1">배선 개요 <a class="header-anchor" href="#배선-개요" aria-label="Permalink to &quot;배선 개요&quot;">​</a></h2><p>아래의 이미지는 주요 센서와 주변 장치(모터 및 서보 출력 제외)들의 연결 방법을 설명합니다. 다음 섹션에서 각 장치에 대하여 자세히 설명합니다.</p><p><img src="'+a+'" alt="퀵 스타트"></p><table><thead><tr><th style="text-align:left;">인터페이스</th><th style="text-align:left;">기능</th></tr></thead><tbody><tr><td style="text-align:left;">전원</td><td style="text-align:left;">전원 모듈을 연결하십시오. 전력 및 ANALOG 전압 및 전류 측정을 제공합니다.</td></tr><tr><td style="text-align:left;">PM2</td><td style="text-align:left;"><a href="./../flight_controller/cuav_v5_nano.html#compatibility_pm2">PX4와 함께 사용하지 마십시오.</a></td></tr><tr><td style="text-align:left;">TF CARD</td><td style="text-align:left;">로그 저장용 SD 카드 (카드와 함께 제공)</td></tr><tr><td style="text-align:left;">M1~M8</td><td style="text-align:left;">PWM 출력 모터와 서보를 콘트롤 합니다.</td></tr><tr><td style="text-align:left;">A1~A3</td><td style="text-align:left;">Capture pins (not <em>currently</em> supported on PX4).</td></tr><tr><td style="text-align:left;">nARMED</td><td style="text-align:left;">FMU 시동 상태를 나타냅니다. 액티브 로우 (시동시 낮음)입니다.</td></tr><tr><td style="text-align:left;">DSU7</td><td style="text-align:left;">FMU 디버그에 사용되며 디버그 정보를 획득합니다.</td></tr><tr><td style="text-align:left;">I2C2/I2C3/I2C4</td><td style="text-align:left;">외부 나침반과 같은 I2C 장치를 연결합니다.</td></tr><tr><td style="text-align:left;">CAN1/CAN2</td><td style="text-align:left;">CAN GPS와 같은 UAVCAN 장치를 연결합니다.</td></tr><tr><td style="text-align:left;">TYPE-C(USB)</td><td style="text-align:left;">펌웨어 업로드 등의 작업시에 비행 콘트롤러와 컴퓨터를 연결합니다.</td></tr><tr><td style="text-align:left;">GPS &amp; SAFETY</td><td style="text-align:left;">GPS, 안전 스위치 및 부저가 포함된 Neo GPS에 연결합니다.</td></tr><tr><td style="text-align:left;">TELEM1/TELEM2</td><td style="text-align:left;">텔레메트리에 연결합니다.</td></tr><tr><td style="text-align:left;">DSM/SBUS/RSSI</td><td style="text-align:left;">DSM, SBUS, RSSI 신호 입력 인터페이스, DSM 인터페이스는 DSM 위성 수신기에 연결 가능, SBUS 인터페이스는 SBUS 원격 제어 수신기에 연결 가능, 신호 강도 반환 모듈용 RSSI 포함.</td></tr></tbody></table><p>:::note 자세한 인터페이스는 <a href="http://manual.cuav.net/V5-nano.pdf" target="_blank" rel="noreferrer">V5 nano 매뉴얼</a>을 참고하십시오. :::</p><p><img src="'+r+'" alt="퀵 스타트"></p><div class="info custom-block"><p class="custom-block-title">If the controller cannot be mounted in the recommended/default orientation (e.g. due to space constraints) you will need to configure the autopilot software with the orientation that you actually used: <a href="./../gps_compass/rtk_gps.html">Flight Controller Orientation</a>.</p></div><h2 id="gps-나침반-안전-스위치-led" tabindex="-1">GPS + 나침반 + 안전 스위치 + LED <a class="header-anchor" href="#gps-나침반-안전-스위치-led" aria-label="Permalink to &quot;GPS + 나침반 + 안전 스위치 + LED&quot;">​</a></h2><p>The recommended GPS module is the <em>Neo v2 GPS</em>, which contains GPS, compass, safety switch, buzzer, LED status light.</p><p>:::note 다른 GPS 모듈은 작동하지 않을 수 있습니다 (<a href="./../flight_controller/cuav_v5_nano.html#compatibility_gps">호환성 문제</a> 참조). :::</p><p>The GPS/Compass module should be <a href="./../assembly/mount_gps_compass.html">mounted on the frame</a> as far away from other electronics as possible, with the direction marker towards the front of the vehicle (Neo GPS arrow is in the same direction as the flight control arrow). 케이블을 사용하여 비행 제어 GPS에 연결합니다.</p><p>:::note CAN GPS를 사용하는 경우 케이블을 사용하여 비행 제어 CAN 인터페이스에 연결하십시오. :::</p><p><img src="'+l+'" alt="퀵 스타트"></p><h2 id="안전-스위치" tabindex="-1">안전 스위치 <a class="header-anchor" href="#안전-스위치" aria-label="Permalink to &quot;안전 스위치&quot;">​</a></h2><p>The dedicated safety switch that comes with the V5+ is only required if you are not using the recommended <em>Neo v2 GPS</em> (which has an inbuilt safety switch).</p><p>GPS 없이 비행시에는 차량 시동 스위치를 <code>GPS1</code> 포트에 직접 연결하여야합니다 (이전 6 핀 GPS를 사용하는 경우에는, 라인 변경에 관련된 하단 인터페이스 매뉴얼을 참고하십시오).</p><h2 id="부저" tabindex="-1">부저 <a class="header-anchor" href="#부저" aria-label="Permalink to &quot;부저&quot;">​</a></h2><p>If you do not use the recommended <em>Neo v2 GPS</em> the buzzer may not work.</p><h2 id="무선-조종" tabindex="-1">무선 조종 <a class="header-anchor" href="#무선-조종" aria-label="Permalink to &quot;무선 조종&quot;">​</a></h2><p>차량을 수동 제어에는 무선 조종기가 필요합니다. PX4의 자율 비행은 무선조종기가 필수 사항은 아닙니다. 기체와 조종자가 통신하기 위하여 송신기와 수신기를 바인딩하여야 합니다. 송신기와 수신기의 매뉴얼을 참고하십시오.</p><p>아래 그림은 원격 수신기에 액세스하는 방법을 보여줍니다 (키트에서 S.BUS 케이블을 찾으십시오)</p><p><img src="'+o+'" alt="퀵 스타트"></p><h2 id="spektrum-satellite-수신기" tabindex="-1">Spektrum Satellite 수신기 <a class="header-anchor" href="#spektrum-satellite-수신기" aria-label="Permalink to &quot;Spektrum Satellite 수신기&quot;">​</a></h2><p>V5 nano에는 전용 DSM 케이블이 있습니다. Spektrum 위성 수신기는 비행 컨트롤러 DSM/SBUS/RSSI 인터페이스에 연결하여야합니다.</p><h2 id="전원" tabindex="-1">전원 <a class="header-anchor" href="#전원" aria-label="Permalink to &quot;전원&quot;">​</a></h2><p>The <em>v5 nano</em> kit includes the <em>HV_PM</em> module, which supports 2~14S LiPo batteries. Connect the 6pin connector of the <em>HW_PM</em> module to the flight control <code>Power</code> interface.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>제공된 전원 모듈은 퓨즈가 없습니다. 주변 장치를 연결하는 동안 전원을 <strong>반드시</strong> 꺼야 합니다.</p></div><p><img src="'+t+'" alt="퀵 스타트"></p><p>:::note 전원 모듈은 PWM 출력에 연결된 주변 장치에 전원 자체를 공급하지 않습니다. 서보/액추에이터를 연결하는 경우에는 BEC를 사용하여 별도로 전원을 공급하여야 합니다. :::</p><h2 id="텔레메트리-선택-사항" tabindex="-1">텔레메트리(선택 사항) <a class="header-anchor" href="#텔레메트리-선택-사항" aria-label="Permalink to &quot;텔레메트리(선택 사항)&quot;">​</a></h2><p>지상국에서는 텔레메트리를 사용하여 기체를 통신, 모니터링, 제어 합니다. 기체를 특정 위치로 움직이도록 지시하거나, 새로운 임무를 업로드할 수 있습니다.</p><p>통신 채널은 텔레메트리를 통하여 이루어집니다. 차량 기반 라디오는 <strong>TELEM1</strong> 또는 <strong>TELEM2</strong> 포트에 연결합니다. 이 포트에 연결되어있는 경우에는 추가 설정이 필요하지 않습니다. 다른 라디오는 지상국 컴퓨터 또는 모바일 장치에 USB를 통하여 연결합니다.</p><p><img src="'+n+'" alt="퀵 스타트"></p><p><a id="sd_card"></a></p><h2 id="sd-카드-선택-사항" tabindex="-1">SD 카드(선택 사항) <a class="header-anchor" href="#sd-카드-선택-사항" aria-label="Permalink to &quot;SD 카드(선택 사항)&quot;">​</a></h2><p>An <a href="./../getting_started/px4_basic_concepts.html#sd-cards-removable-memory">SD card</a> is inserted in the factory (you do not need to do anything).</p><h2 id="모터" tabindex="-1">모터 <a class="header-anchor" href="#모터" aria-label="Permalink to &quot;모터&quot;">​</a></h2><p>모터/서보는 <a href="./../airframes/airframe_reference.html">기체 규격</a>에 지정된 순서대로 MAIN 및 AUX 포트에 연결됩니다.</p><p><img src="'+t+'" alt="퀵 스타트"></p><h2 id="핀배열" tabindex="-1">핀배열 <a class="header-anchor" href="#핀배열" aria-label="Permalink to &quot;핀배열&quot;">​</a></h2><p><img src="'+i+'" alt="V5 nano pinouts"></p><h2 id="추가-정보" tabindex="-1">추가 정보 <a class="header-anchor" href="#추가-정보" aria-label="Permalink to &quot;추가 정보&quot;">​</a></h2><ul><li><a href="./../frames_multicopter/dji_f450_cuav_5nano.html">DJI FlameWheel450 CUAV v5 nano 기체 조립 방법</a></li><li><a href="./../flight_controller/cuav_v5_nano.html">CUAV V5 nano</a></li><li><a href="http://manual.cuav.net/V5-nano.pdf" target="_blank" rel="noreferrer">CUAV V nano 수동</a> (CUAV)</li><li><a href="https://docs.google.com/spreadsheets/d/1-n0__BYDedQrc_2NHqBenG1DNepAgnHpSGglke-QQwY/edit#gid=912976165" target="_blank" rel="noreferrer">FMUv5 기준 설계 핀배열</a> (CUAV)</li><li><a href="https://github.com/cuav" target="_blank" rel="noreferrer">CUAV Github</a> (CUAV)</li></ul>',47),f=[m];function u(_,g,S,b,y,P){return h(),d("div",null,f)}const q=s(p,[["render",u]]);export{A as __pageData,q as default};
